script: |
  super -f text -I q10592.spq | sort > q10592.out

inputs:
  - name: q10592.spq
    data: |
      SELECT + col1 AS col1, + col0 AS col0 FROM tab0 (FORMAT parquet) WHERE ( 10 NOT IN ( - 70, + col2, 39 * + col2, + 7, + - 61 - col0 + - CAST ( - - col1 AS INTEGER ) + - - ( + col0 ) ) );
  - name: tab0

outputs:
  - name: q10592.out
    data: |
      1	97
      81	15
